import React from "react";
import { MDBInput, MDBBtn, MDBContainer } from "mdb-react-ui-kit";

const Create = () => {
  return (
    <>
      <MDBContainer>
        <form className="pt-4">
          <MDBInput type="text" wrapperClass="mb-4" label="Name" />
          <MDBInput type="email" wrapperClass="mb-4" label="Email address" />
          <MDBInput type="number" wrapperClass="mb-4" label="Phone" />
          <MDBInput type="text" wrapperClass="mb-4" label="Address" />
          <MDBInput type="text" wrapperClass="mb-4" label="Status" />
          <MDBBtn type="submit" className="mb-4" block>
            Add User
          </MDBBtn>
        </form>
      </MDBContainer>
    </>
  );
};

export default Create;
